    switch (this.zoom) {
    case 'max':
        document.getElementById('vts-graphs-zoom').innerHTML = 'Scale: Max value';
        break;

    case '120avrg':
        document.getElementById('vts-graphs-zoom').innerHTML = 'Scale: 100% Avrg';
        break;

    case '180avrg':
        document.getElementById('vts-graphs-zoom').innerHTML = 'Scale: 50% Avrg';
        break;
    }

